package ArithmaticOperator;

public class RelationalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=20;
		int b=20;
		
		System.out.println(a>b);//F
		System.out.println(a=b);//T
		System.out.println(a<b);//F
		System.out.println(a>=b);
		System.out.println(a<=b);

	}

}
